import { fakeAuth } from "./fakeAuth";

export const PrivateRoute = ({ component: Component, ...rest }) => (
    <Route {...rest} render={(props) => (
        fakeAuth.isAuthenticated === true ?
            <Component {...props} />
            : <Redirect to="/login" />
    )} />
)
